}


/* お気に入り商品登録 */
div.bookmarkArea {
	width:500px;
}

#rakutenLimitedId_aroundCart #serviceTableSml {
	margin-top:-7px;
}

body div.bkm{
	width: 240px !important;
	height: 65px !important;
}

body div.bookmarkArea div.bkm a.addBkm span.bkmStar {
	display:inline-block !important;
	width: 240px !important;
	height: 65px !important;
	background: url(http://image.rakuten.co.jp/kurashinokoubin/cabinet/toku/favitem.gif) no-repeat !important;
}

/* お気に入り店舗登録 */
body #rakutenLimitedId_aroundCart div.shopBkm {
	padding:7px 0 7px 10px !important;
	width: 240px !important;
	height: 65px !important;
}

body div.shopBookmarkArea div.shopBkm a.addShopBkm span.shopBkmStar {
	display:inline-block !important;
	width: 240px !important;
	height: 65px !important;
	background: url(http://image.rakuten.co.jp/kurashinokoubin/cabinet/toku/favshop.gif) no-repeat !important;
}





/* キャッチコピー上部にラベルがつく */
span.catch_copy:before {
    content: "お買得アイテム！"; /*ラベル内の文言*/
    width: 430px; /*ラベルのサイズ*/
    background-color: #FF0000; /*ラベルの色*/
    font-size: 20px;
    color: #fff;
    text-align: center;
    display: block;
    padding: 1px 4px;
    margin-bottom: 4px;
    border-radius: 2px;
    clear: both;
}

/* 「商品についての問い合わせ」ボタンの大きさ*/
font input{
background: url() #f5f5f5 no-repeat 5px 5px !important; 
font-size:11px !important; 
margin-bottom:10px !important;
padding:5px 6px 6px 15px !important; 
position:relative !important;
z-index:2 !important;
border:solid #d2d2d2 1px !important;
color:#333333 !important;
letter-spacing:0.2em !important;
width: 190px !important;
height: 35px !important;
a:hover {
	position: relative;
	width: auto;
	top: 1px;
	left: 1px;
	text-decoration: none;
}
a:hover img {
	filter: alpha(style=0, opacity=90);
}
img {
	border: 0;
}
#hedmenu a:hover {
	position: relative;
	width: auto;
	top: 0px;
	left: 0px;
	text-decoration: none;
}
#hed_search td {
	font-size: 10px;
