	color: #DC3843;
}
#headWrap {
	margin: 0px;
	width: 930px;
	padding-top: 10px;
	padding-right: 10px;
	padding-bottom: 10px;
	padding-left: 200px;
}

a{/*リンクされた文字*/
    color:#333333;
    font-style:normal;
    text-decoration:underline;
}
a:link {/*未訪問のリンク*/
    color:#333333;
    font-style:normal;
    text-decoration:underline;
}
a:visited {/*訪問後のリンク*/
    color:#ff0000;
    text-decoration:underline;
}
a:hover {/*マウスをのせたとき*/
    color:#009FE8;
    font-style:normal;
    text-decoration:underline;
}
a:active {/*クリック中*/
    text-decoration:none;
}




